INSERT INTO boardgames VALUES
(1,'Sky Team',2023,'Cooperative airplane landing game for two players',2,2,20,12,'Sky Team is a co-operative game, exclusively for two players, in which you play a pilot and co-pilot at the controls of an airliner. Your goal is to work together as a team to land your airplane in different airports around the world.\n\nTo land your plane, you need to silently assign your dice to the correct spaces in your cockpit to balance the axis of your plane, control its speed, deploy the flaps, extend the landing gear, contact the control tower to clear your path, and even have a little coffee to improve your concentration enough to change the value of your dice.\n\nIf the aircraft tilts too much and stalls, overshoots the airport, or collides with another aircraft, you lose the game...and your pilots license...and probably your life.\n\nFrom Montreal to Tokyo, each airport offers its own set of challenges. Watch out for the turbulence as this could end up being a bumpy ride!',2.15,0,0,0,0,'https://cf.geekdo-images.com/uXMeQzNenHb3zK7Hoa6b2w__itemrep/img/oaw-LYEIaB20e79Y568JgyHZ5NQ=/fit-in/246x300/filters:strip_icc()/pic7398904.jpg','https://cf.geekdo-images.com/uXMeQzNenHb3zK7Hoa6b2w__opengraph/img/KtJwilwgxYSN5ODFEXReTm-M8jQ=/0x242:2176x1385/fit-in/1200x630/filters:strip_icc()/pic7398904.jpg','https://www.scorpionmasque.com/en/sky-team','Sky Team - Le Scorpion Masque',0,0,3,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(2,'Wingspan',2019,'Engine-building game about birds',1,5,70,10,'Wingspan is a competitive, medium-weight, card-driven, engine-building board game from Stonemaier Games. You are bird enthusiasts—researchers, bird watchers, ornithologists, and collectors—seeking to discover and attract the best birds to your network of wildlife preserves.',2.42,0,0,0,0,'https://cf.geekdo-images.com/yLZJCVLlIx4c7eJEWUNJ7w__itemrep/img/DR7181wU4sHT6gn6Q1XccpPxNHg=/fit-in/246x300/filters:strip_icc()/pic4458123.jpg','https://www.nintendo.com/eu/media/images/10_share_images/games_15/nintendo_switch_download_software_1/H2x1_NSwitchDS_Wingspan_image1600w.jpg','https://stonemaiergames.com/games/wingspan/','Stonemaier Games Wingspan',0,0,3,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(3,'Gloomhaven',2017,'Tactical combat in a persistent world',1,4,120,14,'Gloomhaven is a game of Euro-inspired tactical combat in a persistent world of shifting motives. Players will take on the role of a wandering adventurer with their own special set of skills and their own reasons for traveling to this dark corner of the world.',3.86,0,0,0,0,'https://cf.geekdo-images.com/sZYp_3BTDGjh2unaZfZmuA__itemrep/img/0IdBRA_G-ZdrNaxI4Z1LPQMZD0I=/fit-in/246x300/filters:strip_icc()/pic2437871.jpg','https://www.houseofgames.it/wp-content/uploads/2017/12/gloomhaven.jpg','https://cephalofair.com/gloomhaven','Cephalofair Games',0,0,3,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(4,'Azul',2017,'Tile-placement game inspired by Portuguese tiles',2,4,45,8,'Introduced by the Moors, azulejos (originally white and blue ceramic tiles) were fully embraced by the Portuguese when their king Manuel I, on a visit to the Alhambra palace in Southern Spain, was mesmerized by the stunning beauty of the Moorish decorative tiles.',1.78,0,0,0,0,'https://cf.geekdo-images.com/aPSHJO0d0XOpQR5X-wJonw__itemrep/img/6oRLPDvy4zz3gOZM6e6NzIk8Seg=/fit-in/246x300/filters:strip_icc()/pic6973671.png','https://www.ultraboardgames.com/img/slideshow/azul.jpg','https://planbgames.com/en/our-games/azul','Plan B Games Azul',0,0,3,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(5,'Pandemic',2008,'Cooperative game about stopping global diseases',2,4,45,8,'In Pandemic, several virulent diseases have broken out simultaneously all over the world! The players are disease-fighting specialists whose mission is to treat disease hotspots while researching cures for each of four plagues before they get out of hand.',2.4,0,0,0,0,'https://cf.geekdo-images.com/S3ybV1LAp-8SnHIXLLjVqA__itemrep/img/wAMLbgihOl7dJDHnvqt7OXKEV-4=/fit-in/246x300/filters:strip_icc()/pic1534148.jpg','https://cf.geekdo-images.com/S3ybV1LAp-8SnHIXLLjVqA__opengraph/img/fNu5AeI1nPD73l9_KNPEurNwBuI=/0x655:976x1167/fit-in/1200x630/filters:strip_icc()/pic1534148.jpg','https://zmangames.com/pandemic/','Z-Man Games Pandemic',0,0,3,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(6,'Catan',1995,'Build and trade in this classic strategy game',3,4,60,10,'In Catan (formerly The Settlers of Catan) , players try to be the dominant force on the island of Catan by building settlements, cities, and roads. On each turn dice are rolled to determine what resources the island produces.',2.32,0,0,0,0,'https://cf.geekdo-images.com/PyUol9QxBnZQCJqZI6bmSA__itemrep/img/zUs-jB7S9JTuLPOcY9pUxaqYNqA=/fit-in/246x300/filters:strip_icc()/pic8632666.png','https://www.nintendo.com/eu/media/images/10_share_images/games_15/nintendo_switch_download_software_1/2x1_NSwitchDS_CatanConsoleEdition.jpg','https://catanstudio.com','Catan Studio',0,0,3,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(7,'Ticket to Ride',2004,'Railway-themed board game',2,5,60,8,'Ticket to Ride is a railway-themed German-style board game designed by Alan R. Moon and published in 2004 by Days of Wonder. The game is also known as Zug um Zug (German, FALSE) , Les Aventuriers du Rail (French, FALSE) , and Aventureros al Tren (Spanish).',1.84,0,0,0,0,'https://cf.geekdo-images.com/ZWJg0dCdrWHxVnc0eFXK8w__itemrep/img/iiTIuTtuneM3tbDCjALecsgyizA=/fit-in/246x300/filters:strip_icc()/pic38668.jpg','https://www.nintendo.com/eu/media/images/10_share_images/games_15/nintendo_switch_download_software_1/2x1_NSwitchDS_TicketToRide_GBen_image1600w.jpg','https://daysofwonder.com/tickettoride/','Days of Wonder',0,0,3,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(8,'Splendor',2014,'Engine building with gems and cards',2,4,30,10,'Splendor is a game of chip-collecting and card development. Players are merchants of the Renaissance trying to buy gem mines, means of transportation, shops—all in order to acquire the most prestige points.',1.78,0,0,0,0,'https://cf.geekdo-images.com/vNFe4JkhKAERzi4T0Ntwpw__itemrep/img/OoBoVLPl4ZYiNioNIKlV_0HLEYQ=/fit-in/246x300/filters:strip_icc()/pic8234167.png','https://gaming-cdn.com/images/products/14788/orig/splendor-pc-gioco-steam-cover.jpg?v=1692696616','https://spacecowboys.fr/splendor','Space Cowboys',0,0,3,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(9,'7 Wonders',2010,'Civilization building through card drafting',2,7,45,10,'7 Wonders is a board game created by Antoine Bauza and originally published in 2010 by Repos Production. Three decks of cards featuring images of ancient civilizations, armed conflicts, and commercial activity are used in the game.',2.33,0,0,0,0,'https://cf.geekdo-images.com/35h9Za_JvMMMtx_92kT0Jg__itemrep/img/EUlr4of74-i75S-jIrgNfaQ3M6Q=/fit-in/246x300/filters:strip_icc()/pic7149798.jpg','https://b1803394.smushcdn.com/1803394/wp-content/uploads/2020/08/7-wonders-review-header-990x557.jpg?lossy=1&strip=1&webp=1','https://rprod.com/7-wonders','Repos Production',0,0,3,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(10,'Codenames',2015,'Word-based party game',2,8,15,14,'Codenames is a social word game with a simple premise and challenging game play. Two rival spymasters know the secret identities of 25 agents. Their teammates know the agents only by their codenames.',1.31,0,0,0,0,'https://cf.geekdo-images.com/nC6ifPCDnAItwoKSKXVrnw__itemrep/img/iM9m6bb1zTCzDzkXhiKE5V1gomc=/fit-in/246x300/filters:strip_icc()/pic8907965.jpg','https://cf.geekdo-images.com/nC6ifPCDnAItwoKSKXVrnw__opengraph/img/a-o7v0YkRyRVid6iCqqsA5CwIsY=/0x0:1906x1001/fit-in/1200x630/filters:strip_icc()/pic8907965.jpg','https://czechgames.com/en/codenames/','Czech Games Edition',0,0,3,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(11,'Sky Team: Houston Airport Expansion',2024,'Aggiunge l aeroporto di Houston con nuove difficoltà e scenari',2,2,20,14,'Introduces Houston as a new challenging airport with turbulence and air traffic modules.',2.2,0,0,0,0,'.../skyteam-houston.jpg','.../skyteam-houston-thumb.jpg','https://www.le-scorpion-masque.com/en/games/skyteam/houston','Sky Team: Houston Expansion',0,0,0,0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(12,'Sky Team: World Tour Expansion',2025,'Espansione con nuove rotte globali e condizioni climatiche estreme',2,2,25,14,'Adds new airports from five continents, including snowstorms and night landings.',2.3,0,0,0,0,'.../skyteam-world.jpg','.../skyteam-world-thumb.jpg','https://www.le-scorpion-masque.com/en/games/skyteam/world-tour','Sky Team: World Tour',0,0,0,0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(13,'Sky Team: Emergency Protocols',2025,'Modalità avanzata con guasti tecnici e gestione del panico',2,2,30,14,'Features emergency checklists, system failures and a panic meter.',2.5,0,0,0,0,'.../skyteam-emergency.jpg','.../skyteam-emergency-thumb.jpg','https://www.le-scorpion-masque.com/en/games/skyteam/emergency','Sky Team: Emergency Protocols',0,0,0,0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(14,'Sky Team: Deluxe Edition',2024,'Edizione deluxe con segnalini in legno e inserti premium',2,2,20,14,'Includes upgraded tokens, custom dice, and a neoprene board.',2.2,0,0,0,0,'.../skyteam-deluxe.jpg','.../skyteam-deluxe-thumb.jpg','https://www.le-scorpion-masque.com/en/games/skyteam/deluxe','Sky Team Deluxe Edition',0,0,0,0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
