(16,'Sky Team: Solo Pilot Edition',2025,'Versione per giocatore singolo con AI automatica',1,1,20,14,'Adds solo mode with automated co-pilot and mission cards.',2.4,0,0,0,0,'.../skyteam-solo.jpg','.../skyteam-solo-thumb.jpg','https://www.le-scorpion-masque.com/en/games/skyteam/solo','Sky Team Solo Pilot Edition',0,0,0,0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(17,'Sky Team: Collector s Tin',2024,'Con scatola in latta e badge esclusivo',2,2,20,14,'Includes limited edition tin and enamel pilot badge.',2.2,0,0,0,0,'.../skyteam-collectors.jpg','.../skyteam-collectors-thumb.jpg','https://www.le-scorpion-masque.com/en/games/skyteam/collectors','Sky Team Collector s Tin',0,0,0,0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(18,'Sky Team: Japanese Edition',2024,'Versione localizzata per il Giappone',2,2,20,14,'Complete translation and packaging in Japanese.',2.2,0,0,0,0,'.../skyteam-jp.jpg','.../skyteam-jp-thumb.jpg','https://example.jp/skyteam','Sky Team 日本語版',0,0,0,0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(19,'Wingspan: European Expansion',2019,'Adds European birds with new abilities and strategies',1,5,70,10,'This expansion includes new birds from Europe, featuring new powers, abilities, and purple egg tokens. It integrates seamlessly into the base game.',2.55,0,0,0,0,'https://cf.geekdo-images.com/european.jpg','https://cf.geekdo-images.com/european-thumb.jpg','https://stonemaiergames.com/games/wingspan/european-expansion','Wingspan European Expansion',0,0,0,0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
