(91,'Carcassonne',2000,'Place tiles and claim areas to score points.',2,5,45,7,'Players draw and place a tile with a piece of southern French landscape on it. The tile might feature a city, a road, a cloister, grassland or some combination thereof, and it must be placed adjacent to tiles that have already been played, in such a way that cities are connected to cities, roads to roads, etcetera.',1.9,0,0,0,0,'https://www.goblins.net/files/styles/inline_full/public/images/carcassonne-cover.jpg?itok=aIUuux-W','https://shared.fastly.steamstatic.com/store_item_assets/steam/apps/598810/capsule_616x353.jpg?t=1741270649','https://www.zmangames.com/en/games/carcassonne/','Z-Man Games Carcassonne',0,0,8,12,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(92,'Terraforming Mars',2016,'Compete to transform Mars into a habitable planet.',1,5,120,12,'In the 2400s, mankind begins to terraform the planet Mars. Giant corporations, sponsored by the World Government on Earth, initiate huge projects to raise the temperature, the oxygen level, and the ocean coverage until the environment is habitable.',3.25,0,0,0,0,'https://img.dungeondice.it/52909-large_default/terraforming-mars.jpg','https://shared.fastly.steamstatic.com/store_item_assets/steam/apps/800270/header.jpg?t=1741270803','https://www.fryxgames.se/games/terraforming-mars/','FryxGames Terraforming Mars',0,0,6,8,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(93,'Scythe',2016,'Lead your faction to victory in a post-apocalyptic world.',1,5,115,14,'Scythe is an engine-building, asymmetric, competitive board game set in an alternate-history 1920s period. It is a time of farming and war, broken hearts and rusted gears, innovation and valor.',3.42,0,0,0,0,'https://www.ghenosgames.com/wp-content/uploads/products/Flat_Scythe-scaled.jpg','https://www.orderofgamers.com/wordpress/wp-content/uploads/2016/06/scythe.jpg','https://stonemaiergames.com/games/scythe/','Stonemaier Games Scythe',0,0,4,6,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(94,'Dominion',2008,'Build your deck and expand your kingdom in this classic game.',2,4,30,13,'In Dominion, each player starts with an identical, very small deck of cards. In the center of the table is a selection of other cards the players can \"buy\" as they can afford them.',2.36,0,0,0,0,'https://www.goblins.net/files/styles/zoom/public/images/game/bgg/dominion.jpg?itok=F-ioVvG6','https://img.pastemagazine.com/wp-content/uploads/2022/06/21074637/dominion-card-game-main.jpg','https://riograndegames.com/games/dominion/','Rio Grande Games Dominion',0,0,13,8,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(95,'Root',2018,'An asymmetric game of adventure and war.',2,4,90,10,'Root is a game of adventure and war in which 2 to 4 players battle for control of a vast wilderness. The nefarious Marquise de Cat has seized the great woodland, intent on harvesting its riches.',3.75,0,0,0,0,'https://www.goblins.net/files/styles/zoom/public/images/game/bgg/root.jpg?itok=XJKRtdhg','https://cf.geekdo-images.com/JUAUWaVUzeBgzirhZNmHHw__opengraph/img/lnl-mnvbEge_7gtTD-sCxoI5NhY=/0x170:2048x1245/fit-in/1200x630/filters:strip_icc()/pic4254509.jpg','https://ledergames.com/products/root-a-game-of-woodland-might-and-right','Leder Games Root',0,0,8,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(96,'Spirit Island',2017,'Defend your island home from colonial invaders.',1,4,120,13,'Spirit Island is a complex and thematic cooperative game about defending your island home from colonizing Invaders. Players are different spirits of the land, each with its own unique elemental powers.',3.97,0,0,0,0,'https://img.dungeondice.it/49803-large_default/spirit-island.jpg','https://cf.geekdo-images.com/kjCm4ZvPjIZxS-mYgSPy1g__opengraph/img/QryNeb0O2AHNe521HAsddL3E8Wg=/0x0:1680x882/fit-in/1200x630/filters:strip_icc()/pic7013651.jpg','https://store.greaterthangames.com/spirit-island.html','Greater Than Games Spirit Island',0,0,6,3,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(97,'Pax Pamir (Second Edition)',2019,'Influence and control the Afghan empire.',1,5,120,13,'In Pax Pamir, players assume the role of nineteenth century Afghan leaders attempting to forge a new state after the collapse of the Durrani Empire.',3.85,0,0,0,0,'https://www.goblins.net/files/styles/inline_full/public/images/pax-pamir-2nd-cover.jpg?itok=8V-6-0U1','https://cdn.tomshw.it/storage/wp/new-images/2020/11/pax-pamir-128901.jpg?width=1260&aspect_ratio=16:9','https://wehrlegig.com/products/pax-pamir-second-edition','Wehrlegig Games Pax Pamir',0,0,2,1,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(98,'Heat: Pedal to the Metal',2022,'Race cars with real-time decisions and adrenaline.',1,6,60,10,'Based on simple and intuitive hand management, Heat: Pedal to the Metal puts players in the drivers seat of intense car races, jockeying for position to cross the finish line first.',2.75,0,0,0,0,'https://www.uplay.it/storage/309224/conversions/heat-pedal-to-the-metal-foto.webp','https://cf.geekdo-images.com/-vOrd4bOspibyohYExLqWg__opengraph/img/MVFAnKPe_CLYCz5pTanfu26NFrg=/0x0:1316x691/fit-in/1200x630/filters:strip_icc()/pic6940449.png','https://www.daysofwonder.com/heat/','Days of Wonder Heat',0,0,3,2,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(99,'The Crew: Mission Deep Sea',2021,'Cooperative trick-taking in the depths of the ocean.',2,5,20,10,'In the trick-taking card game The Crew: Mission Deep Sea, you and the other players work together to search for the lost continent of Mu.',2.2,0,0,0,0,'https://cf.geekdo-images.com/gPoIYJs3kbkPJi8NB88jhA__opengraph/img/1kw6p53ex9S1OH1KKgJFHWVckAU=/fit-in/1200x630/filters:strip_icc()/pic6873085.png','https://cf.geekdo-images.com/98LnQShydr11OBKS46xY-Q__opengraph/img/cvS7N76w8O89KboTaQ9CIx0nVzs=/0x0:1440x756/fit-in/1200x630/filters:strip_icc()/pic5687013.jpg','https://www.kosmos.de/spielware/spiele/kartenspiele/the-crew','Kosmos The Crew Mission Deep Sea',0,0,0,2,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(100,'Exploding Kittens',2015,'Ask for favors, attack friends- whatever it takes to avoid exploding!',2,5,15,7,'Exploding Kittens is a kitty-powered version of Russian Roulette. Players take turns drawing cards until someone draws an exploding kitten and loses the game.',1.23,0,0,0,0,'https://www.goblins.net/files/styles/zoom/public/exploding-kittens.png?itok=KbsS30iv','https://www.nintendo.com/eu/media/images/10_share_images/games_15/nintendo_switch_download_software_1/H2x1_NSwitchDS_ExplodingKittens_image1600w.jpg','https://explodingkittens.com/','Exploding Kittens Game',0,0,8,5,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(101,'The Crew',2019,'Work together to complete missions in this cooperative trick-taking game.',3,5,20,10,'The Crew: The Quest for Planet Nine is a cooperative trick-taking card game. Players work together to complete various missions.',2,0,0,0,0,'https://www.goblins.net/files/styles/zoom/public/images/game/bgg/crew-quest-planet-nine.jpg?itok=UZrLvP1m','https://i.ytimg.com/vi/5Na-NltWncA/maxresdefault.jpg','https://store.thamesandkosmos.com/products/the-crew','Kosmos The Crew',0,0,0,3,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(102,'Patchwork',2014,'Compete to create the most beautiful quilt in this two-player game.',2,2,30,8,'In Patchwork, two players compete to build the most aesthetic (and high-scoring) patchwork quilt on a personal 9x9 game board.',1.64,0,0,0,0,'https://images.squarespace-cdn.com/content/v1/61c86bfc61ba11700703f07a/1700096865224-UEF15VZC3BIQEDDEOILE/pic2270442.jpg?format=2500w','https://cf.geekdo-images.com/RDOwMRBnIb3Ehl6GyXj9xg__opengraph/img/qBR6U9r5b69OKV7Lc47g0Q-clJ8=/0x0:600x315/fit-in/1200x630/filters:strip_icc()/pic8669620.jpg','https://lookout-spiele.de/games/patchwork/','Lookout Games Patchwork',0,0,3,4,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(103,'7 Wonders Duel',2015,'A two-player version of the classic game, focusing on strategy and civilization building.',2,2,30,10,'7 Wonders Duel lasts three ages. In each age, players receive seven cards from a particular deck, choose one, and pass the remainder to their opponent.',2.22,0,0,0,0,'https://www.meeple.it/upload/601_601/7-wonders-duel.jpg','https://cf.geekdo-images.com/zdagMskTF7wJBPjX74XsRw__mediacard/img/OTmEfmtsErSd1otMsKfvjDMrNgo=/0x0:720x405/288x162/filters:strip_icc()/pic2576399.jpg','https://rprod.com/7-wonders-duel','Repos Production 7 Wonders Duel',0,0,3,2,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(104,'The Castles of Burgundy',2011,'Develop your estate through strategic tile placement.',2,4,90,12,'The Castles of Burgundy is set in the Burgundy region of High Medieval France. Each player takes on the role of an aristocrat, originally controlling a small princedom.',3,0,0,0,0,'https://cdn.anyfinder.eu/assets/e69eeea5f009fc1ddd02a00e322b8653aedd7473e23b92a1dbf0778a9e867b74','https://cf.geekdo-images.com/VrNrk7XVU1hN0j1ZFhjcjw__opengraph/img/XD9GWcTsoQoI054cZVYGhlPp7zo=/0x110:1191x736/fit-in/1200x630/filters:strip_icc()/pic4934938.jpg','https://www.alderac.com/castles-of-burgundy/','Alderac Entertainment Group',0,0,5,3,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(105,'Everdell',2018,'A city building and worker placement game with woodland creatures.',1,4,80,13,'Within the charming valley of Everdell, beneath the boughs of towering trees, among meandering streams and mossy hollows, a civilization of forest critters is thriving and expanding.',2.86,0,0,0,0,'https://www.goblins.net/files/styles/inline_full/public/images/everdell-cover.jpg?itok=SAQ1igdu','https://www.nintendo.com/eu/media/images/10_share_images/games_15/nintendo_switch_download_software_1/2x1_NSwitchDS_Everdell_image1600w.jpg','https://starling.games/everdell-game/','Starling Games Everdell',0,0,6,4,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(106,'Pandemic Legacy',2015,'A narrative-driven campaign version of Pandemic.',2,4,60,13,'Pandemic Legacy is a co-operative campaign game, with an overarching story-arc played through 12-24 sessions, depending on how well your group does at the game.',2.83,0,0,0,0,'https://www.goblins.net/files/styles/zoom/public/pandemic-legacy-season-1.png?itok=Kl1l3IBZ','https://cf.geekdo-images.com/-Qer2BBPG7qGGDu6KcVDIw__opengraph/img/FpOzBnjHMIirKNbZjOD6vxwlQYU=/0x182:899x654/fit-in/1200x630/filters:strip_icc()/pic2452831.png','https://zmangames.com/pandemic-legacy/','Z-Man Games Pandemic Legacy',0,0,0,2,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(107,'Cryptid',2018,'Use deduction to discover the location of the cryptid.',3,5,50,10,'Cryptid is a unique deduction game of honest misdirection in which players must determine the location of the mysterious cryptid.',2.75,0,0,0,0,'https://m.media-amazon.com/images/I/81Ij5ix7LYL._UF1000,1000_QL80_.jpg','https://cf.geekdo-images.com/qrPLpAnhFgc470ZRuXlvbg__opengraph/img/KeYcVzaUzEk8XEr_LOBY-oe1pjk=/0x236:1000x761/fit-in/1200x630/filters:strip_icc()/pic4037705.jpg','https://osprey.games/cryptid/','Osprey Games Cryptid',0,0,0,1,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(108,'Colt Super Express',2014,'A programmable action game set in the Wild West.',2,6,40,10,'On the 11th of July, 1899 at 10 a.m., the Union Pacific Express has left Folsom, New Mexico, with 47 passengers on board. After a few minutes, gunfire and horse galloping noises are heard.',2.13,0,0,0,0,'https://m.media-amazon.com/images/I/61SEVsQXOML._UF1000,1000_QL80_.jpg','https://www.msedizioni.it/wp-content/uploads/2021/03/slider-msedizioni-COLT-EXPRESS.jpg','https://ludonaute.fr/portfolio/colt-express/','Ludonaute Colt Express',0,0,6,3,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(109,'Here to Slay',2020,'Gather your party and slay monsters in this strategic card game.',2,6,30,14,'Here to Slay is a competitive role-playing fantasy strategy card game that combines player vs player gameplay with monster slaying.',1.95,0,0,0,0,'https://www.balenaludens.it/wp-content/uploads/2021/06/HTSb.jpg','https://i.ytimg.com/vi/gsPZoEJyYMM/maxresdefault.jpg','https://www.unstablegames.com/here-to-slay','Unstable Games Here to Slay',0,0,2,1,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(110,'Le leggende di Andor',2012,'Cooperative fantasy adventure in the kingdom of Andor.',2,4,90,10,'Legends of Andor is a cooperative adventure board game for two to four players in which a band of heroes must work together to defend a fantasy realm from invading hordes.',2.69,0,0,0,0,'https://www.the-forge.it/wp-content/uploads/2020/11/leggende-di-andor-featured.jpg','https://i.ytimg.com/vi/kPEH4MzYazU/hq720.jpg?sqp=-oaymwEhCK4FEIIDSFryq4qpAxMIARUAAAAAGAElAADIQj0AgKJD&rs=AOn4CLBjFu8BNzJ0ecEoe23aL6xSolLGuA','https://kosmos.de/spielware/spiele/familienspiele/die-legenden-von-andor','Kosmos Legends of Andor',0,0,6,4,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(111,'Akros',2014,'Explore and excavate ancient temples on Greek islands.',2,2,45,13,'Akros places you in the role of an explorer in Classical Greek times, combing the then-uncharted Aegean sea for lost Minoan temples that have long ago fallen into ruin.',2.54,0,0,0,0,'https://cf.geekdo-images.com/SWEFgWLWyDE3PI6PAgA14w__itemrep/img/tB9dH7bfni6TyGRaU8CU9AoWbXI=/fit-in/246x300/filters:strip_icc()/pic5252329.png','https://cf.geekdo-images.com/SWEFgWLWyDE3PI6PAgA14w__opengraph/img/cCACybzLFGVkfPBhx_uKvq_jV3k=/0x0:627x329/fit-in/1200x630/filters:strip_icc()/pic5252329.png','https://zmangames.com/Akros/','Z-Man Games Akros',0,0,0,1,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(112,'Bloodborne: The Board Game',2021,'Dive into the dark and challenging world of Bloodborne in this strategic board game.',1,4,90,14,'Bloodborne: The Board Game is based on the Chalice Dungeons in the Sony PlayStation 4 Bloodborne video game. Players choose one of seven Hunters and explore the labyrinthine Chalice Dungeon.',3.1,0,0,0,0,'https://cf.geekdo-images.com/clKFvn2bUUPbY62eSmc-ig__itemrep/img/wVo4koJHfQohXYH98nmnNM2BxSU=/fit-in/246x300/filters:strip_icc()/pic4757839.png','https://cf.geekdo-images.com/clKFvn2bUUPby62eSmc-ig__opengraph/img/HgFW_nqwz0hynw4cfsrTZmeY4tA=/0x51:640x387/fit-in/1200x630/filters:strip_icc()/pic4757839.png','https://cmon.com/bloodborne','CMON Bloodborne',0,0,3,2,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(113,'Kemet',2012,'Control ancient Egyptian armies and summon mythical powers to dominate the battlefield.',2,5,120,13,'In Kemet, players each deploy the troops of an Egyptian tribe and use the mystical powers of the gods of ancient Egypt – along with their powerful armies – to score points in glorious battles or through invasion of rich territories.',2.99,0,0,0,0,'https://cf.geekdo-images.com/RmZjhy7_6REp8IaXh9Zqwg__opengraph/img/eMLc6_NcS9qHkDSxsP1XW2UGKeM=/0x0:1804x947/fit-in/1200x630/filters:strip_icc()/pic3979527.jpg','https://cf.geekdo-images.com/RmZjhy7_6REp8IaXh9Zqwg__opengraph/img/eMLc6_NcS9qHkDSxsP1XW2UGKeM=/0x0:1804x947/fit-in/1200x630/filters:strip_icc()/pic3979527.jpg','https://www.matagot.com/en/catalog/details/expert-games/1/kemet/454','Matagot Kemet',0,0,4,2,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(114,'Evolversi Male',2023,'Evolve the only way you know how: badly!',3,6,45,12,'In Evolversi Male, players must guide their species through a chaotic evolutionary process. Make terrible decisions and watch your creatures develop in hilariously unexpected ways.',2.1,0,0,0,0,'https://www.giochisulnostrotavolo.it/wp-content/uploads/2024/04/pic8159039.jpg','https://cf.geekdo-images.com/9MkqsvemLpZElwjZPbyodA__opengraph/img/UpiuABXcgoFsECHiXGLlLVvBkYE=/0x141:2048x1216/fit-in/1200x630/filters:strip_icc()/pic8159039.jpg','https://evolversi-male.example.com','Evolversi Male Game',0,0,2,1,1,'0000-00-00 00:00:00','0000-00-00 00:00:00'),
(115,'Intrighi a Corte',2020,'Manipulate and outwit your opponents in this game of courtly intrigue.',3,5,60,14,'Navigate the treacherous waters of royal court politics. Use secret alliances, blackmail, and cunning to climb the social ladder and eliminate your rivals.',2.8,0,0,0,0,'https://gugimages.s3.us-east-2.amazonaws.com/wp-content/uploads/2024/07/05084112/courtisansbox-478x900.jpg','https://i.ytimg.com/vi/wGALg6g3nHQ/maxresdefault.jpg','https://intrighi-corte.example.com','Intrighi a Corte Game',0,0,3,1,1,'0000-00-00 00:00:00','0000-00-00 00:00:00');
